var attendanceService = {
  punch: async (coords, userId, timestamp2, c) => {
    const { validated, distance } = await attendanceService.validateLocation(coords);
    if (!validated) {
      return c.json(ApiResponse(`You are currently outside the office location. ${distance}`, 403), 403);
    }
    const time2 = new Date(timestamp2);
    const date2 = time2.toISOString().split("T")[0];
    const record = await attendanceService.getAttendaceRecord(date2, userId);
    if (!record) {
      const uniqueDevice = await attendanceService.validateUniqueDevice(date2, coords.deviceId);
      if (!uniqueDevice) {
        return c.json(ApiResponse("Attendance already marked on this device.", 403), 403);
      }
      const newRecord = await attendanceService.punchIn(date2, time2, userId, coords.deviceId);
      if (!newRecord)
        c.json(ApiResponse("Someting wend wrong", 400), 400);
      return c.json(ApiResponse("Punch In Successful", 201), 201);
    }
    if (record) {
      const updatedRecord = await attendanceService.punchOut(date2, time2, userId);
      if (!updatedRecord)
        c.json(ApiResponse("Someting wend wrong", 400), 400);
      return c.json(ApiResponse(record.punchOut ? `Punch Out time updated ${distance}` : '"Punch Out Successful"', 200), 200);
    }
  },
  getAttendaceRecord: async (date2, userId) => {
    const record = await db.select().from(attendanceRecord).where(and(eq(attendanceRecord.date, date2), eq(attendanceRecord.userId, userId)));
    if (!record || !record[0])
      return null;
    return record[0];
  },
  punchIn: async (date2, time2, userId, deviceId) => {
    const newRecord = await db.insert(attendanceRecord).values({
      userId,
      date: date2,
      punchIn: time2,
      deviceId
    }).returning();
    if (!newRecord || !newRecord[0])
      return false;
    return true;
  },
  punchOut: async (date2, time2, userId) => {
    const updatedRecord = await db.update(attendanceRecord).set({ punchOut: time2 }).where(and(eq(attendanceRecord.date, date2), eq(attendanceRecord.userId, userId))).returning();
    if (!updatedRecord || !updatedRecord[0])
      return false;
    return true;
  },
  getTodayAttendance: async (userId, c) => {
    const today = new Date().toISOString().split("T")[0];
    const record = await db.select({
      punchIn: attendanceRecord.punchIn,
      punchOut: attendanceRecord.punchOut,
      date: attendanceRecord.date
    }).from(attendanceRecord).where(and(eq(attendanceRecord.date, today), eq(attendanceRecord.userId, userId)));
    if (!record.length)
      return c.json(ApiResponse("No record found for today", 404), 404);
    return c.json({
      message: "Today's attendance record fetched successfully",
      statusCode: 200,
      data: record[0]
    });
  },
  getMonthlyAttendance: async (c, userId, year, month) => {
    const record = await db.select({
      date: attendanceRecord.date,
      punchIn: attendanceRecord.punchIn,
      punchOut: attendanceRecord.punchOut
    }).from(attendanceRecord).where(and(eq(attendanceRecord.userId, userId), sql`EXTRACT(YEAR FROM ${attendanceRecord.date}) = ${year}`, sql`EXTRACT(MONTH FROM ${attendanceRecord.date}) = ${month}`)).orderBy(attendanceRecord.date);
    return c.json({
      message: "Attendance fetched successfully",
      statusCode: 200,
      data: record
    });
  },
  validateLocation: async (coords) => {
    const officeLat = 28.586147;
    const officeLng = 77.3162862;
    const distance = haversineDistance(officeLat, officeLng, coords.latitude, coords.longitude);
    console.log("accuracy", coords.accuracy);
    console.log("distance", distance);
    if (distance > coords.accuracy) {
      return { validated: false, distance };
    }
    return { validated: true, distance };
  },
  validateUniqueDevice: async (date2, deviceId) => {
    const record = await db.select({ deviceId: attendanceRecord.deviceId }).from(attendanceRecord).where(and(eq(attendanceRecord.date, date2), eq(attendanceRecord.deviceId, deviceId))).limit(1);
    if (record.length)
      return false;
    return true;
  }
};

