    const refreshToken = await generateRefreshToken(user.id, user.role);
    return c.json({
      success: true,
      accessToken,
      refreshToken,
      expiresIn: 900,
      user: {
        id: user.id,
        firstName: user.firstName,
        lastName: user.lastName,
        role: user.role,
        contact: user.contact,
        email: user.email
      }
    });
